def plot4d(data):
    fig = plt.figure(figsize=(5, 5))
    ax = fig.add_subplot(projection="3d")
    ax.xaxis.pane.fill = False
    ax.yaxis.pane.fill = False
    ax.zaxis.pane.fill = False
    mask = data > 0.01
    idx = np.arange(int(np.prod(data.shape)))
    x, y, z = np.unravel_index(idx, data.shape)
    ax.scatter(x, y, z, c=data.flatten(), s=10.0 * mask, edgecolor="face", alpha=1.0, marker="o", cmap="summer", linewidth=0)
    # ax.colorbar()
    plt.tight_layout()
    # plt.savefig("test_scatter_4d.png", dpi=250)
    # plt.close(fig)
    plt.show()


